import 'bootstrap/dist/css/bootstrap.min.css';
import Carousel from "react-multi-carousel";
import "../node_modules/react-multi-carousel/lib/styles.css"

const responsive = {
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3,
      slidesToSlide: 3 // optional, default to 1.
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2,
      slidesToSlide: 2 // optional, default to 1.
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1,
      slidesToSlide: 1 // optional, default to 1.
    }
  };

function Carousel2() {
    return(<>
        <Carousel
        swipeable={false}
        draggable={false}
        showDots={true}
        responsive={responsive}
        ssr={true} // means to render carousel on server-side.
        infinite={true}
        autoPlay={this.props.deviceType !== "mobile" ? true : false}
        autoPlaySpeed={1000}
        keyBoardControl={true}
        customTransition="all .5"
        transitionDuration={500}
        containerClass="carousel-container"
        removeArrowOnDeviceType={["tablet", "mobile"]}
        deviceType={this.props.deviceType}
        dotListClass="custom-dot-list-style"
        itemClass="carousel-item-padding-40-px"
      >
        <div><img src="https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg" alt="" /></div>
        <div><img src="https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg" alt="" />Item 2</div>
        <div><img src="https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg" alt="" />Item 3</div>
        <div><img src="https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg" alt="" />Item 4</div>
      </Carousel>; 
        </>);
};
export default Carousel2;
